  const [diaryDatas, setdiaryDatas] = useState([]);
  return (
    <div className="App">
      <DiaryEditor setdiaryData={setdiaryDatas}/>
      <DiaryList  diaryData={diaryDatas}/> 
    </div>
  );
}

export default App;
